import MainComponent from '../assets/css/MainComponent.style'

class Main extends React.Component {
  render(){
    return (
      <MainComponent>
        <div className="content text-center">
          <h2>If you Don’t Practice
            You Don’t Derserve
            to win!
          </h2>
        </div>
      </MainComponent>
    )
  }

}
export default Main;
